import React,{Component} from 'react'


class Home extends Component{


    render(){
        const {firstname , lastname , age} = this.props ;
        return <div>
            welcome to home page Component <br />
            my name is {this.props.lastname} {this.props.firstname} I'am {this.props.age} years old

        </div>
    }
}
export default Home;
